import { AutoComplete, InputNumber, InputText } from "primereact";
import React, { useState } from "react";

export const FormsEmployee = () => {
  const [filteredCountries, setFilteredCountries] = useState([]);
  const [selectedCountry1, setSelectedCountry1] = useState(null);

  const countries = [
    { name: "Pepe Jose", id_person: "asdasdasdasdasd" },
    { name: "Lucho Pancho", id_person: "sdasda" },
    { name: "Juan Carlos", id_person: "qwe123" },
    { name: "Mario Jose", id_person: "gfsd23" },
  ];

  const searchCountry = (event: any) => {
    setTimeout(() => {
      let _filteredCountries: any;
      if (!event.query.trim().length) {
        _filteredCountries = [...countries];
      } else {
        _filteredCountries = countries.filter((country) => {
          return country.name
            .toLowerCase()
            .startsWith(event.query.toLowerCase());
        });
      }

      setFilteredCountries(_filteredCountries);
    }, 250);
  };
  return (
    <React.Fragment>
      <h1>Form Employee</h1>
      <div>
        <form>
          <div>
            <span className="p-float-label">
              <InputNumber
                inputId="currency-us"
                mode="currency"
                currency="USD"
                locale="en-US"
                id="salary"
              />
              <label htmlFor="salary">Salary</label>
            </span>
          </div>
          <div>
            <span className="p-float-label">
              <InputNumber
                id="hours_extra"
                inputId="minmax"
                mode="decimal"
                min={0}
                max={40}
              />
              <label htmlFor="hours_extra">Hours Extra</label>
            </span>
          </div>
          <div>
            <span className="p-float-label">
              <InputText id="deparment" value={""} />
              <label htmlFor="deparment">Username</label>
            </span>
          </div>
          <div>
            <span className="p-float-label">
              <label htmlFor="person_id">Name person</label>
              <AutoComplete
                value={selectedCountry1}
                suggestions={filteredCountries}
                completeMethod={searchCountry}
                field="name"
                onChange={(e) => setSelectedCountry1(e.value)}
                aria-label="Countries"
              />
            </span>
          </div>
        </form>
      </div>
    </React.Fragment>
  );
};
